const CustomCard = ({singleItem}) => {


  return (
    <div className="card text-bg-primary mb-3">
      <div className="card-header">Status: {singleItem.status}  Zone: {props.zone}</div>
      <div className="card-body">
        <h5 className="card-title">Instance Name: {singleItem.name}</h5>
        <p className="card-text">Last Started: {singleItem.lastStartTimestamp}</p>
        <br />
        <p className="card-text">Last Stopped: {singleItem.lastStopTimestamp}</p>
      </div>
    </div>
  )
}
